using System;

namespace Myloyorrrr
{
    public class BinaryTree //–∫–ª–∞—Å—Å, —Ä–µ–∞–ª–∏–∑—É—é—â–∏–π –ê–¢–î ¬´–¥–µ—Ä–µ–≤–æ –±–∏–Ω–∞—Ä–Ω–æ–≥–æ –ø–æ–∏—Å–∫–∞¬ª
    {
        //–≤–ª–æ–∂–µ–Ω–Ω—ã–π –∫–ª–∞—Å—Å, –æ—Ç–≤–µ—á–∞—é—â–∏–π –∑–∞ —É–∑–ª—ã –∏ –æ–ø–µ—Ä–∞—Ü–∏–∏ –¥–æ–ø—É—Å—Ç–∏–º—ã –¥–ª—è –¥–µ—Ä–µ–≤–∞ –±–∏–Ω–∞—Ä–Ω–æ–≥–æ
        //–ø–æ–∏—Å–∫–∞
        private class Node
        {
            public object inf; //–∏–Ω—Ñ–æ—Ä–º–∞—Ü–∏–æ–Ω–Ω–æ–µ –ø–æ–ª–µ
            public Node left; //—Å—Å—ã–ª–∫–∞ –Ω–∞ –ª–µ–≤–æ–µ –ø–æ–¥–¥–µ—Ä–µ–≤–æ
            public Node right; //—Å—Å—ã–ª–∫–∞ –Ω–∞ –ø—Ä–∞–≤–æ–µ –ø–æ–¥–¥–µ—Ä–µ–≤–æ
            public int height; //–≤—ã—Å–æ—Ç–∞ —É–∑–ª–∞
                               
            //–∫–æ–Ω—Å—Ç—Ä—É–∫—Ç–æ—Ä –≤–ª–æ–∂–µ–Ω–Ω–æ–≥–æ –∫–ª–∞—Å—Å–∞, —Å–æ–∑–¥–∞–µ—Ç —É–∑–µ–ª –¥–µ—Ä–µ–≤–∞
            public Node(object nodeInf)
            {
                inf = nodeInf;
                left = null;
                right = null;
                height = 1;
            }
            public static int Height(Node node)
            {
                if (node == null) 
                    return 0;
                return node.height;
            }

            public void NewHeight() //–ø–µ—Ä–µ—Å—á–µ—Ç –≤—ã—Å–æ—Ç—ã
            {
                this.height = (Math.Max(Height(this.right), Height(this.left)) + 1);
            }


            //–¥–æ–±–∞–≤–ª—è–µ—Ç —É–∑–µ–ª –≤ –¥–µ—Ä–µ–≤–æ —Ç–∞–∫, —á—Ç–æ–±—ã –¥–µ—Ä–µ–≤–æ –æ—Å—Ç–∞–≤–∞–ª–æ—Å—å –¥–µ—Ä–µ–≤–æ–º –±–∏–Ω–∞—Ä–Ω–æ–≥–æ –ø–æ–∏—Å–∫–∞
            public static void Add(ref Node r, object nodeInf)
            {
                if (r == null)
                {
                    r = new Node(nodeInf);
                }
                else
                {
                    if (((IComparable)(r.inf)).CompareTo(nodeInf) > 0)
                    {
                        Add(ref r.left, nodeInf);
                    }
                    else
                    {
                        Add(ref r.right, nodeInf);
                    }
                    r.NewHeight();
                }
            }
            public static void Preorder(Node r) //–ø—Ä—è–º–æ–π –æ–±—Ö–æ–¥ –¥–µ—Ä–µ–≤–∞
            {
                if (r != null)
                {
                    Console.WriteLine("{0}, –≤—ã—Å–æ—Ç–∞: {1}.", r.inf, r.height);
                    Preorder(r.left);
                    Preorder(r.right);
                }
            }
            public static void Inorder(Node r) //—Å–∏–º–º–µ—Ç—Ä–∏—á–Ω—ã–π –æ–±—Ö–æ–¥ –¥–µ—Ä–µ–≤–∞
            {
                if (r != null)
                {
                    Inorder(r.left);
                    Console.Write("{0} ", r.inf);
                    Inorder(r.right);
                }
            }
            public static void Postorder(Node r) //–æ–±—Ä–∞—Ç–Ω—ã–π –æ–±—Ö–æ–¥ –¥–µ—Ä–µ–≤–∞
            {
                if (r != null)
                {
                    Postorder(r.left);
                    Postorder(r.right);
                    Console.Write("{0} ", r.inf);
                }
            }

            //–ø–æ–∏—Å–∫ –∫–ª—é—á–µ–≤–æ–≥–æ —É–∑–ª–∞ –≤ –¥–µ—Ä–µ–≤–µ
            public static void Search(Node r, object key, out Node item)
            {
                if (r == null)
                {
                    item = null;
                }
                else
                {
                    if (((IComparable)(r.inf)).CompareTo(key) == 0)
                    {
                        item = r;
                    }
                    else
                    {
                        if (((IComparable)(r.inf)).CompareTo(key) > 0)
                        {
                            Search(r.left, key, out item);
                        }
                        else
                        {
                            Search(r.right, key, out item);
                        }
                    }
                }
            }
            //–º–µ—Ç–æ–¥—ã Del –∏ Delete –ø–æ–∑–≤–æ–ª—è—é—Ç —É–¥–∞–ª–∏—Ç—å —É–∑–µ–ª –≤ –¥–µ—Ä–µ–≤–µ —Ç–∞–∫, —á—Ç–æ–±—ã –¥–µ—Ä–µ–≤–æ –ø—Ä–∏ —ç—Ç–æ–º
            //–æ—Å—Ç–∞–≤–∞–ª–æ—Å—å –¥–µ—Ä–µ–≤–æ–º –±–∏–Ω–∞—Ä–Ω–æ–≥–æ –ø–æ–∏—Å–∫–∞
            private static void Del(Node t, ref Node tr)
            {
                if (tr.right != null)
                {
                    Del(t, ref tr.right);
                    t.NewHeight();
                }
                else
                {
                    t.inf = tr.inf;
                    tr = tr.left;
                    tr.NewHeight();
                }
            }
            public static void Delete(ref Node t, object key)
            {
                if (t == null)
                {
                    throw new Exception("–î–∞–Ω–Ω–æ–µ –∑–Ω–∞—á–µ–Ω–∏–µ –≤ –¥–µ—Ä–µ–≤–µ –æ—Ç—Å—É—Ç—Å—Ç–≤—É–µ—Ç");
                }
                else
                {
                    if (((IComparable)(t.inf)).CompareTo(key) > 0)
                    {
                        Delete(ref t.left, key);
                        t.NewHeight();
                    }
                    else
                    {
                        if (((IComparable)(t.inf)).CompareTo(key) < 0)
                        {
                            Delete(ref t.right, key);
                            t.NewHeight();
                        }
                        else
                        {
                            if (t.left == null)
                            {
                                t = t.right;
                            }
                            else
                            {
                                if (t.right == null)
                                {
                                    t = t.left;
                                }
                                else
                                {
                                    Del(t, ref t.left);
                                    t.NewHeight();
                                }
                            }
                        }
                    }
                }
            }
            public static bool IsBalanced(Node node)
            {
                if (node == null)
                    return true;

                if (Math.Abs(Height(node.left) - Height(node.right)) <= 1 && IsBalanced(node.left) && IsBalanced(node.right))
                {
                    return true;
                }
                return false;
            }

        } 
        //–∫–æ–Ω–µ—Ü –≤–ª–æ–∂–µ–Ω–Ω–æ–≥–æ –∫–ª–∞—Å—Å–∞
        Node tree; //—Å—Å—ã–ª–∫–∞ –Ω–∞ –∫–æ—Ä–µ–Ω—å –¥–µ—Ä–µ–≤–∞
                   //—Å–≤–æ–π—Å—Ç–≤–æ –ø–æ–∑–≤–æ–ª—è–µ—Ç –ø–æ–ª—É—á–∏—Ç—å –¥–æ—Å—Ç—É–ø –∫ –∑–Ω–∞—á–µ–Ω–∏—é –∏–Ω—Ñ–æ—Ä–º–∞—Ü–∏–æ–Ω–Ω–æ–≥–æ –ø–æ–ª—è –∫–æ—Ä–Ω—è –¥–µ—Ä–µ–≤–∞

        public object Inf
        {
            set { tree.inf = value; }
            get { return tree.inf; }
        }
        public BinaryTree() //–æ—Ç–∫—Ä—ã—Ç—ã–π –∫–æ–Ω—Å—Ç—Ä—É–∫—Ç–æ—Ä
        {
            tree = null;
        }
        private BinaryTree(Node r) //–∑–∞–∫—Ä—ã—Ç—ã–π –∫–æ–Ω—Å—Ç—Ä—É–∫—Ç–æ—Ä
        {
            tree = r;
        }
        public void Add(object nodeInf) //–¥–æ–±–∞–≤–ª–µ–Ω–∏–µ —É–∑–ª–∞ –≤ –¥–µ—Ä–µ–≤–æ
        {
            Node.Add(ref tree, nodeInf);
        }
        //–æ—Ä–≥–∞–Ω–∏–∑–∞—Ü–∏—è —Ä–∞–∑–ª–∏—á–Ω—ã—Ö —Å–ø–æ—Å–æ–±–æ–≤ –æ–±—Ö–æ–¥–∞ –¥–µ—Ä–µ–≤–∞
        public void Preorder()
        {
            Node.Preorder(tree);
        }
        public void Inorder()
        {
            Node.Inorder(tree);
        }
        public void Postorder()
        {
            Node.Postorder(tree);
        }

        //–ø–æ–∏—Å–∫ –∫–ª—é—á–µ–≤–æ–≥–æ —É–∑–ª–∞ –≤ –¥–µ—Ä–µ–≤–µ
        public BinaryTree Search(object key)
        {
            Node r;
            Node.Search(tree, key, out r);
            BinaryTree t = new BinaryTree(r);
            return t;
        }
        //—É–¥–∞–ª–µ–Ω–∏–µ –∫–ª—é—á–µ–≤–æ–≥–æ —É–∑–ª–∞ –≤ –¥–µ—Ä–µ–≤–µ
        public void Delete(object key)
        {
            Node.Delete(ref tree, key);
        }

        public bool Balance() //3 –¥–µ—Ä–µ–≤—å—è - –ø—Ä–æ–≤–µ—Ä—è–µ–º —Å–±–∞–ª–∞–Ω—Å–∏—Ä–æ–≤–∞–Ω–æ –ª–∏ –¥–µ—Ä–µ–≤–æ 
        {
            return Node.IsBalanced(tree);
        }
    }
}
