using System;

namespace Myloyorrrr
{
    public class Queue
    {
        private class Node //–≤–ª–æ–∂–µ–Ω–Ω—ã–π –∫–ª–∞—Å—Å, —Ä–µ–∞–ª–∏–∑—É—é—â–∏–π –±–∞–∑–æ–≤—ã–π —ç–ª–µ–º–µ–Ω—Ç –æ—á–µ—Ä–µ–¥–∏
        {
            private object inf;
            private Node next;
            public Node(object nodeInfo)
            {
                inf = nodeInfo;
                next = null;
            }
            public Node Next
            {
                get { return next; }
                set { next = value; }
            }
            public object Inf
            {
                get { return inf; }
                set { inf = value; }
            }
        } //–∫–æ–Ω–µ—Ü –∫–ª–∞—Å—Å–∞ Node
        private Node head;
        private Node tail;
        public Queue()
        {
            head = null;
            tail = null;
        }
        public void Add(object nodeInfo)
        {
            Node r = new Node(nodeInfo);
            if (head == null)
            {
                head = r;
                tail = r;
            }
            else
            {
                tail.Next = r;
                tail = r;
            }
        }
        public object Take()
        {
            if (head == null)
            {
                throw new Exception("–û—á–µ—Ä–µ–¥—å –ø—É—Å—Ç–∞.");
            }
            else
            {
                Node r = head; //1
                head = head.Next; //2
                if (head == null) //3
                {
                    tail = null; //4
                }
                return r.Inf; //5
            }
        }
        public bool IsEmpty
        {
            get
            {
                if (head == null)
                {
                    return true;
                }
                else
                {
                    return false;
                }
            }
        }
    }
}


