namespace Myloyorrrr
{
    public class Graph
    {
        private class Node //–≤–ª–æ–∂–µ–Ω–Ω—ã–π –∫–ª–∞—Å—Å –¥–ª—è —Å–∫—Ä—ã—Ç–∏—è –¥–∞–Ω–Ω—ã—Ö –∏ –∞–ª–≥–æ—Ä–∏—Ç–º–æ–≤
        {
            private double[,] array; //–º–∞—Ç—Ä–∏—Ü–∞ —Å–º–µ–∂–Ω–æ—Å—Ç–∏
            public double this[int i, int j] //–∏–Ω–¥–µ–∫—Å–∞—Ç–æ—Ä –¥–ª—è –æ–±—Ä–∞—â–µ–Ω–∏—è –∫ –º–∞—Ç—Ä–∏—Ü–µ —Å–º–µ–∂–Ω–æ—Å—Ç–∏
            {
                get
                {
                    return array[i, j];
                }
                set
                {
                    array[i, j] = value;
                }
            }
            public int Size //—Å–≤–æ–π—Å—Ç–≤–æ –¥–ª—è –ø–æ–ª—É—á–µ–Ω–∏—è —Ä–∞–∑–º–µ—Ä–Ω–æ—Å—Ç–∏ –º–∞—Ç—Ä–∏—Ü—ã —Å–º–µ–∂–Ω–æ—Å—Ç–∏
            {
                get
                {
                    return array.GetLength(0);
                }
            }
            private bool[] nov; //–≤—Å–ø–æ–º–æ–≥–∞—Ç–µ–ª—å–Ω—ã–π –º–∞—Å—Å–∏–≤: –µ—Å–ª–∏ i-—ã–π —ç–ª–µ–º–µ–Ω—Ç –º–∞—Å—Å–∏–≤–∞ —Ä–∞–≤–µ–Ω
                                //true, —Ç–æ i-–∞—è –≤–µ—Ä—à–∏–Ω–∞ –µ—â–µ –Ω–µ –ø—Ä–æ—Å–º–æ—Ç—Ä–µ–Ω–∞; –µ—Å–ª–∏ i-—ã–π
                                //—ç–ª–µ–º–µ–Ω—Ç —Ä–∞–≤–µ–Ω false, —Ç–æ i-–∞—è –≤–µ—Ä—à–∏–Ω–∞ –ø—Ä–æ—Å–º–æ—Ç—Ä–µ–Ω–∞
            public void NovSet() //–º–µ—Ç–æ–¥ –ø–æ–º–µ—á–∞–µ—Ç –≤—Å–µ –≤–µ—Ä—à–∏–Ω—ã –≥—Ä–∞—Ñ–∞ –∫–∞–∫ –Ω–µ–ø—Ä–æ—Å–º–æ—Ç—Ä–µ–Ω—ã–µ
            {
                for (int i = 0; i < Size; i++)
                {
                    nov[i] = true;
                }
            }
            //–∫–æ–Ω—Å—Ç—Ä—É–∫—Ç–æ—Ä –≤–ª–æ–∂–µ–Ω–Ω–æ–≥–æ –∫–ª–∞—Å—Å–∞, –∏–Ω–∏—Ü–∏–∞–ª–∏–∑–∏—Ä—É–µ—Ç –º–∞—Ç—Ä–∏—Ü—É —Å–º–µ–∂–Ω–æ—Å—Ç–∏ –∏
            // –≤—Å–ø–æ–º–æ–≥–∞—Ç–µ–ª—å–Ω—ã–π –º–∞—Å—Å–∏–≤
            public Node(double[,] a)
            {
                array = a;
                nov = new bool[a.GetLength(0)];
            
            }

            public void Add(int a, int b)
            {
                if (a >= 0 && a < Size && b >= 0 && b < Size)
                {
                    //array[a - 1, b - 1] = 1; // –î–ª—è –æ—Ä–≥—Ä–∞—Ñ–∞
                    array[b - 1, a - 1] = 1; // –î–ª—è –Ω–µ–æ—Ä–≥—Ä–∞—Ñ–∞
                }
                else
                {
                    Console.WriteLine("–ù–µ–∫–æ—Ä—Ä–µ–∫—Ç–Ω—ã–µ –≤–µ—Ä—à–∏–Ω—ã");
                }
            }

            //—Ä–µ–∞–ª–∏–∑–∞—Ü–∏—è –∞–ª–≥–æ—Ä–∏—Ç–º–∞ –æ–±—Ö–æ–¥–∞ –≥—Ä–∞—Ñ–∞ –≤ –≥–ª—É–±–∏–Ω—É
            public void Dfs(int v)
            {
                Console.Write("{0} ", v); //–ø—Ä–æ—Å–º–∞—Ç—Ä–∏–≤–∞–µ–º —Ç–µ–∫—É—â—É—é –≤–µ—Ä—à–∏–Ω—É
                nov[v] = false; //–ø–æ–º–µ—á–∞–µ–º –µ–µ –∫–∞–∫ –ø—Ä–æ—Å–º–æ—Ç—Ä–µ–Ω–Ω—É—é
                                // –≤ –º–∞—Ç—Ä–∏—Ü–µ —Å–º–µ–∂–Ω–æ—Å—Ç–∏ –ø—Ä–æ—Å–º–∞—Ç—Ä–∏–≤–∞–µ–º —Å—Ç—Ä–æ–∫—É —Å –Ω–æ–º–µ—Ä–æ–º v
                for (int u = 0; u < Size; u++)
                {
                    //–µ—Å–ª–∏ –≤–µ—Ä—à–∏–Ω—ã v –∏ u —Å–º–µ–∂–Ω—ã–µ, –∫ —Ç–æ–º—É –∂–µ –≤–µ—Ä—à–∏–Ω–∞ u –Ω–µ –ø—Ä–æ—Å–º–æ—Ç—Ä–µ–Ω–∞,
                    if (array[v, u] != 0 && nov[u])
                    {
                        Dfs(u); // —Ç–æ —Ä–µ–∫—É—Ä—Å–∏–≤–Ω–æ –ø—Ä–æ—Å–º–∞—Ç—Ä–∏–≤–∞–µ–º –≤–µ—Ä—à–∏–Ω—É
                    }
                }
            }
            //—Ä–µ–∞–ª–∏–∑–∞—Ü–∏—è –∞–ª–≥–æ—Ä–∏—Ç–º–∞ –æ–±—Ö–æ–¥–∞ –≥—Ä–∞—Ñ–∞ –≤ —à–∏—Ä–∏–Ω—É
            public void Bfs(int v)
            {
                Queue q = new Queue(); // –∏–Ω–∏—Ü–∏–∞–ª–∏–∑–∏—Ä—É–µ–º –æ—á–µ—Ä–µ–¥—å
                q.Add(v); //–ø–æ–º–µ—â–∞–µ–º –≤–µ—Ä—à–∏–Ω—É v –≤ –æ—á–µ—Ä–µ–¥—å
                nov[v] = false; // –ø–æ–º–µ—á–∞–µ–º –≤–µ—Ä—à–∏–Ω—É v –∫–∞–∫ –ø—Ä–æ—Å–º–æ—Ç—Ä–µ–Ω–Ω—É—é
                while (!q.IsEmpty) // –ø–æ–∫–∞ –æ—á–µ—Ä–µ–¥—å –Ω–µ –ø—É—Å—Ç–∞
                {
                    v = (int)q.Take(); //–∏–∑–≤–ª–µ–∫–∞–µ–º –≤–µ—Ä—à–∏–Ω—É –∏–∑ –æ—á–µ—Ä–µ–¥–∏
                    Console.Write("{0} ", v); //–ø—Ä–æ—Å–º–∞—Ç—Ä–∏–≤–∞–µ–º –µ–µ
                    for (int u = 0; u < Size; u++) //–Ω–∞—Ö–æ–¥–∏–º –≤—Å–µ –≤–µ—Ä—à–∏–Ω—ã
                    {
                        if (array[v, u] != 0 && nov[u]) // —Å–º–µ–∂–Ω—ã–µ —Å –¥–∞–Ω–Ω–æ–π –∏ –µ—â–µ –Ω–µ –ø—Ä–æ—Å–º–æ—Ç—Ä–µ–Ω–Ω—ã–µ
                        {
                            q.Add(u); //–ø–æ–º–µ—â–∞–µ–º –∏—Ö –≤ –æ—á–µ—Ä–µ–¥—å
                            nov[u] = false; //–∏ –ø–æ–º–µ—á–∞–µ–º –∫–∞–∫ –ø—Ä–æ—Å–º–æ—Ç—Ä–µ–Ω–Ω—ã–µ
                        }
                    }
                }
            }
            //—Ä–µ–∞–ª–∏–∑–∞—Ü–∏—è –∞–ª–≥–æ—Ä–∏—Ç–º–∞ –î–µ–π–∫—Å—Ç—Ä—ã
            public double[] Dijkstr(int v, int nz, out int[] p)
            {
                //—Å–æ–∑–¥–∞–µ–º –º–∞—Ç—Ä–∏—Ü—ã d –∏ p
                double[] d = new double[Size]; // –º–∞—Å—Å–∏–≤ —Ä–∞—Å—Å—Ç–æ—è–Ω–∏–π
                p = new int[Size]; // –º–∞—Å—Å–∏–≤ –ø—Ä–µ–¥—ã–¥—É—â–∏—Ö –≤–µ—Ä—à–∏–Ω –ø—É—Ç–µ–π
                
                for (int u = 0; u < Size; u++)
                {
                    d[u] = int.MaxValue;
                    p[u] = -1;
                }
                d[v] = 0;
                nov[nz] = false; //–Ω–µ —Ö–æ–¥–∏–º –≤ –≥–æ—Ä–æ–¥ –Ω–µ–Ω—É–∂–Ω—ã–π

                for (int i = 0; i < Size-1; i++) 
                {
                    // –≤—ã–±–∏—Ä–∞–µ–º –∏–∑ –º–Ω–æ–∂–µ—Å—Ç–≤–∞ V\S —Ç–∞–∫—É—é –≤–µ—Ä—à–∏–Ω—É w, —á—Ç–æ D[w] –º–∏–Ω–∏–º–∞–ª—å–Ω–æ
                    double min = int.MaxValue;
                    int w = 0;
                    for (int u = 0; u < Size; u++)
                    {
                        if (nov[u] && min > d[u])
                        {
                            min = d[u];
                            w = u;
                        }
                    }

                    nov[w] = false; //–ø–æ–º–µ—â–∞–µ–º w –≤ –º–Ω–æ–∂–µ—Å—Ç–≤–æ S
                                    //–¥–ª—è –∫–∞–∂–¥–æ–π –≤–µ—Ä—à–∏–Ω—ã –∏–∑ –º–Ω–æ–∂–µ—Å—Ç–≤–∞ V\S –æ–ø—Ä–µ–¥–µ–ª—è–µ–º –∫—Ä–∞—Ç—á–∞–π—à–∏–π –ø—É—Ç—å –æ—Ç
                                    // –∏—Å—Ç–æ—á–Ω–∏–∫–∞ –¥–æ —ç—Ç–æ–π –≤–µ—Ä—à–∏–Ω—ã
                    for (int u = 0; u < Size; u++)
                    {
                        double distance = d[w] + array[w, u];
                        if (nov[u] && d[u] > distance && array[w, u] != 0)
                        {
                            d[u] = distance;
                            p[u] = w;
                        }
                    }
                }
                return d; //–≤ –∫–∞—á–µ—Å—Ç–≤–µ —Ä–µ–∑—É–ª—å—Ç–∞—Ç–∞ –≤–æ–∑–≤—Ä–∞—â–∞–µ–º –º–∞—Å—Å–∏–≤ –∫—Ä–∞—Ç—á–∞–π—à–∏—Ö –ø—É—Ç–µ–π –¥–ª—è
            } 
            //–∑–∞–¥–∞–Ω–Ω–æ–≥–æ –∏—Å—Ç–æ—á–Ω–∏–∫–∞
            //–≤–æ—Å—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–∏–µ –ø—É—Ç–∏ –æ—Ç –≤–µ—Ä—à–∏–Ω—ã a –¥–æ –≤–µ—Ä—à–∏–Ω—ã b –¥–ª—è –∞–ª–≥–æ—Ä–∏—Ç–º–∞ –î–µ–π–∫—Å—Ç—Ä—ã
            //public void WayDijkstr(int a, int b, double[] p, ref Stack items)
            //{
            //    items.Push(b); //–ø–æ–º–µ—â–∞–µ–º –≤–µ—Ä—à–∏–Ω—É b –≤ —Å—Ç–µ–∫
            //    if (a == p[b]) //–µ—Å–ª–∏ –ø—Ä–µ–¥—ã–¥—É—â–µ–π –¥–ª—è –≤–µ—Ä—à–∏–Ω—ã b —è–≤–ª—è–µ—Ç—Å—è –≤–µ—Ä—à–∏–Ω–∞ –∞, —Ç–æ
            //    {
            //        items.Push(a); //–ø–æ–º–µ—â–∞–µ–º –∞ –≤ —Å—Ç–µ–∫ –∏ –∑–∞–≤–µ—Ä—à–∞–µ–º –≤–æ—Å—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–∏–µ –ø—É—Ç–∏
            //    }
            //    else //–∏–Ω–∞—á–µ –º–µ—Ç–æ–¥ —Ä–µ–∫—É—Ä—Å–∏–≤–Ω–æ –≤—ã–∑—ã–≤–∞–µ—Ç —Å–∞–º —Å–µ–±—è –¥–ª—è –ø–æ–∏—Å–∫–∞ –ø—É—Ç–∏
            //    { //–æ—Ç –≤–µ—Ä—à–∏–Ω—ã –∞ –¥–æ –≤–µ—Ä—à–∏–Ω—ã, –ø—Ä–µ–¥—à–µ—Å—Ç–≤—É—é—â–µ–π –≤–µ—Ä—à–∏–Ω–µ b
            //        WayDijkstr(a, p[b], p, ref items);
            //    }
            //}

            //—Ä–µ–∞–ª–∏–∑–∞—Ü–∏—è –∞–ª–≥–æ—Ä–∏—Ç–º–∞ –§–ª–æ–π–¥–∞
            public double[,] Floyd(out int[,] p)
            {
                int i, j, k;
                //—Å–æ–∑–¥–∞–µ–º –º–∞—Å—Å–∏–≤—ã —Ä –∏ –∞
                double[,] a = new double[Size, Size];
                p = new int[Size, Size];
                for (i = 0; i < Size; i++)
                {
                    for (j = 0; j < Size; j++)
                    {
                        if (i == j)
                        {
                            a[i, j] = 0;
                        }
                        else
                        {
                            if (array[i, j] == 0)
                            {
                                a[i, j] = int.MaxValue;
                            }
                            else
                            {
                                a[i, j] = array[i, j];
                            }
                        }
                        p[i, j] = -1;
                    }
                }
                //–æ—Å—É—â–µ—Å—Ç–≤–ª—è–µ–º –ø–æ–∏—Å–∫ –∫—Ä–∞—Ç—á–∞–π—à–∏—Ö –ø—É—Ç–µ–π
                for (k = 0; k < Size; k++)
                {
                    for (i = 0; i < Size; i++)
                    {
                        for (j = 0; j < Size; j++)
                        {
                            double distance = a[i, k] + a[k, j];
                            if (a[i, j] > distance)
                            {
                                a[i, j] = distance;
                                p[i, j] = k;
                            }
                        }
                    }
                }
                return a;//–≤ –∫–∞—á–µ—Å—Ç–≤–µ —Ä–µ–∑—É–ª—å—Ç–∞—Ç–∞ –≤–æ–∑–≤—Ä–∞—â–∞–µ–º –º–∞—Å—Å–∏–≤ –∫—Ä–∞—Ç—á–∞–π—à–∏—Ö –ø—É—Ç–µ–π –º–µ–∂–¥—É
            }

            //–≤–æ—Å—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–∏–µ –ø—É—Ç–∏ –æ—Ç –≤–µ—Ä—à–∏–Ω—ã a –¥–æ –≤–µ—Ä—à–∏–Ω—ã –≤ –¥–ª—è –∞–ª–≥–æ—Ä–∏—Ç–º–∞ –§–ª–æ–π–¥–∞
            public void WayFloyd(int a, int b, int[,] p, ref Queue items)
            {
                int k = p[a, b];
                //–µ—Å–ª–∏ k<> -1, —Ç–æ –ø—É—Ç—å —Å–æ—Å—Ç–æ–∏—Ç –±–æ–ª–µ–µ —á–µ–º –∏–∑ –¥–≤—É—Ö –≤–µ—Ä—à–∏–Ω –∞ –∏ b, –∏ –ø—Ä–æ—Ö–æ–¥–∏—Ç —á–µ—Ä–µ–∑
                //–≤–µ—Ä—à–∏–Ω—É k, –ø–æ—ç—Ç–æ–º—É
                if (k != -1)
                {
                    // —Ä–µ–∫—É—Ä—Å–∏–≤–Ω–æ –≤–æ—Å—Å—Ç–∞–Ω–∞–≤–ª–∏–≤–∞–µ–º –ø—É—Ç—å –º–µ–∂–¥—É –≤–µ—Ä—à–∏–Ω–∞–º–∏ –∞ –∏ k
                    WayFloyd(a, k, p, ref items);
                    items.Add(k); //–ø–æ–º–µ—â–∞–µ–º –≤–µ—Ä—à–∏–Ω—É –∫ –≤ –æ—á–µ—Ä–µ–¥—å
                                  // —Ä–µ–∫—É—Ä—Å–∏–≤–Ω–æ –≤–æ—Å—Å—Ç–∞–Ω–∞–≤–ª–∏–≤–∞–µ–º –ø—É—Ç—å –º–µ–∂–¥—É –≤–µ—Ä—à–∏–Ω–∞–º–∏ k –∏ b
                    WayFloyd(k, b, p, ref items);
                }
            }
        } 
        
        //–∫–æ–Ω–µ—Ü –≤–ª–æ–∂–µ–Ω–Ω–æ–≥–æ –∫–ª–∞c—Å–∞
        private Node graph; //–∑–∞–∫—Ä—ã—Ç–æ–µ –ø–æ–ª–µ, —Ä–µ–∞–ª–∏–∑—É—é—â–µ–µ –ê–¢–î ¬´–≥—Ä–∞—Ñ¬ª
        private List<GorodaOnline> l;
        public Graph(string name) //–∫–æ–Ω—Å—Ç—Ä—É–∫—Ç–æ—Ä –≤–Ω–µ—à–Ω–µ–≥–æ –∫–ª–∞—Å—Å–∞
        {
            using (StreamReader file = new StreamReader(name))
            {
                int n = int.Parse(file.ReadLine());
                l = new List<GorodaOnline>();
                for (int i = 0; i<n; i++)
                {
                    string line = file.ReadLine();
                    string[] mas = line.Split(' ');
                    l.Add(new GorodaOnline(mas[0], int.Parse(mas[1]), int.Parse(mas[2])));
                }

                double[,] a = new double[n, n];
                for (int i = 0; i < n; i++)
                {
                    string line = file.ReadLine();
