def lista_palabras():
    finaliza = ""
    global lista_de_palabras
    lista_de_palabras = []
    while finaliza != "fin":
        palabra = input("Ingrese palabra: ")
        if palabra == "fin":
            print("Saliendo")
            finaliza = palabra
        else:
            print(f"Agregado {palabra} a la lista.")
            lista_de_palabras.append([palabra, imprimir_cantidad_vocales(palabra)])
    return lista_de_palabras


